export const getConfig = () => {
  const tokens = JSON.parse(localStorage.getItem("tokens"));
  const Authorization = `Bearer ${tokens.access}`;

  const config = {
    headers: {
      Authorization,
    },
  };

  return config;
};
export const getConfigFree = () => {
  const tokensFree = JSON.parse(localStorage.getItem("tokensFree"));
  const Authorization = `Bearer ${tokensFree.access}`;

  const config = {
    headers: {
      Authorization,
    },
  };

  return config;
};
